padding: 3rem 0;

section {
  display: grid;
  grid-template-columns: 1fr;

  .heading {
    font-size: 2rem;
    font-weight: bold;
    line-height: 1.2;
    margin-bottom: 2rem;
  }

  .events {
    display: grid;
    grid-template-columns: 1fr;
    grid-gap: 3rem;

    .item {
      dt {
        font-size: 1.75rem;
        line-height: 1.1;
        margin-bottom: 1rem;
        font-weight: 500;
      }
      dd {
        margin-bottom: 1rem;
