          font-size: 1.25rem;
          font-weight: 500;

          span {
            display: block;
          }
        }

        .location {
          color: #555;
        }
      }

      a {
        border: 2px solid #222;
        padding: 0.5rem 1rem;
        display: inline-block;

        &:hover {
          color: white;
          background: #222;
        }
      }

      &:not(:last-child) {
        border-bottom: 1px solid #eee;
        padding-bottom: 3rem;
      }
    }
  }
}

@media (min-width: 900px) {
  section {
    grid-template-columns: 1fr 3fr;
    gap: 2rem;

    .events {
    	grid-template-columns: 1fr 1fr;

      .item {
        justify-self: right;
        border-bottom: 0 !important;
        padding-bottom: 0 !important;
      }
    }
  }
}

