--verydarkgray: #222222;

header {
  padding: 10rem 0;
  background: center / cover no-repeat;
  background-image: url(https://placeimg.com/1000/1000/tech);
  background-color: rgba(10, 10, 10, .8);
  background-blend-mode: multiply;
  text-align: center;
  color: white;

  .container {
    .heading {
      font-size: 3rem;
      font-weight: 600;
      margin-bottom: 1rem;
    }
    .subheading {
      font-size: 1.5rem;
    }
    .links {
      display: flex;
      justify-content: center;
      padding: 1rem;
      .button {
        text-transform: uppercase;
        background-color: white;
        color: var(--verydarkgray);
        font-family: var(--display-font);
        font-weight: 700;
        font-size: 1rem;
        letter-spacing: 0.2625rem;
        margin: 1rem;
        padding: 1rem 2rem;
        border-radius: 2rem;
        box-shadow: 0px 0.625rem 1.25rem rgba(0, 0, 0, 0.2);

        &:hover {
          color: white;
          background: var(--color-accent);
        }
      }
    }
  }
}

ul {
  display: flex;
  flex-direction: column;
  list-style: none;
  justify-content: center;
  font-family: var(--display-font);
  font-weight: 600;
  text-transform: uppercase;
  font-size: 0.8125rem;
  padding: 0;
}

footer {
  background-color: #eee;	
  padding: 2rem 0;
  transition: color 0.1s, opacity 0.1s;

