    padding-top: 2rem;
    padding-bottom: 2rem;

    .logo img {
      display: inline-block;
      width: 100%;
      max-width: 10rem;
      margin-bottom: 1rem;
    }

		.primo {
			font-size: 0.75rem;
  		font-weight: bold;
  		&:hover { color:rgb(248,68,73) }
    }

    .content {
      display: grid;
      grid-template-columns: 1fr;
      gap: 2rem;
      .icon-item {
        display: flex;
        align-items: center;
        flex-wrap: wrap;
        font-weight: 600;

        i {
          margin-right: 0.5rem;
        }
      }
      & > div {
        h4 {
					font-weight: 600;
          font-size: 1.25rem;
          margin-bottom: 0.25rem;
        }
      }
    }

  }
}

